.github-DialogPrompt {
  margin: 10px;
  text-align: center;
  font-size: 1.2em;
}
.github-DialogInputs {
  display: flex;
  flex-direction: column;
  padding: 5px;
}
.github-DialogLabel {
  flex: 1;
  margin: 5px;
  line-height: 2;
}
.github-DialogButtons {
  display: flex;
  justify-content: flex-end;
  padding: 5px;
}
.platform-win32 .github-DialogButtons {
  flex-direction: row-reverse;
  justify-content: flex-start;
}
.github-DialogButtons .btn {
  margin: 5px;
}
.github-DialogSpinner {
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px;
}
.github-DialogSpinner .loading {
  margin: 10px;
}
.github-Dialog atom-text-editor[mini].editor {
  margin: 0;
}
